const Faq = () => {
  return (
    <>
      <div className="quiz">
        <div class="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="flexRadioDefault"
            id="flexRadioDefault1"
          />
          <label class="form-check-label" for="flexRadioDefault1">
            Default radio
          </label>
        </div>
      </div>
    </>
  );
};

export default Faq;
